import React from "react";
import "../assets/styles/components/tile.css";

const Tile = props => {
  return (
    <section className="tile">
      <a href={props.link} target="_blank">
        <img src={require(props.logo)} alt="Connect on Github" />
      </a>
    </section>
  );
};

export default Tile;
